import { FunctionComponent } from 'react';
import Style from './Css/Button.module.css';

type PropsButton = { 
    onClick? (): void;
    css: string | any;
    text: string | any;
    type:string;
};

export const Button: FunctionComponent<PropsButton>  =({onClick, text}) => {

  return (    
    <div className={Style.Button} onClick={onClick} id='Button'>
      <div>
        <span>
          <img src='./Icon.svg'></img>
        </span>
      </div> 
      <div>
        <label>{text}</label>   
      </div>
    </div>
  );
};
